    public async Task ComputeNPV()
    {
        var criteria = criteriaVM.MapToModel();
        criteria = await Http.PostJsonAsync<NPVCriteria>("api/NPV", criteria);
        Navigation.NavigateTo("npv/result/" + criteria.ReferenceId);
    }


